import { Container, Content } from "./style";
import Beer from "./../../assets/—Pngtree—summer summer beer_4695539.png";
const Home = () => {
  return (
    <Container>
      <Content>
        <div>
          <h1>Bebidas Artesanais</h1>
          <p></p>
          <button>Bebidas</button>
        </div>
        <figure>
          <img src={Beer} alt="beer" />
        </figure>
      </Content>
    </Container>
  );
};
export default Home;
